import React, { Component } from "react";
import Title from "./Title";
import { FaCat, FaDog, FaBird, FaFrog } from "react-icons/fa";

export default class Services extends Component {
  state = {
    services: [
      {
        icon: <FaCat />,
        title: "Cats",
        info: "Cat Services",
      },
      {
        icon: <FaDog />,
        title: "Dogs",
        info: "Dog Services",
      },
      {
        icon: <FaDog />,
        title: "Birds",
        info: "Bird Services",
      },
      {
        icon: <FaDog />,
        title: "Frogs",
        info: "Frog Services",
      },
    ],
  };
  render() {
    return (
      <section className="services">
        <Title title="Services" />
        <div className="services-center">{this.state.services.map}</div>
      </section>
    );
  }
}
